1918e1373f4d3be8e02b237548ec7de0294798c1:
query FetchAllTokens($id_gt: ID!) {
  tokens(first: 1000, where: {id_gt: $id_gt}) {
    id
    name
    decimals
    symbol
    underlyingAddress
    isListed
    isNativeAssetSuperToken
    isSuperToken
  }
}

bdf7d32258bb3fcbeb4b24de95187ca54d761c40:
query FetchTokensStatistics($id_gt: ID!) {
  tokenStatistics(
    first: 1000
    where: {id_gt: $id_gt, token_: {isSuperToken: true}}
  ) {
    id
    totalNumberOfHolders
    totalNumberOfClosedStreams
    totalNumberOfActiveStreams
    token {
      isListed
    }
  }
}
